import React from "react";
import './App.css';

function addServer() {
	console.log("add server");

	let result = "";

	fetch("127.0.0.1:3001/add", {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
			_IP: "127.0.0.1",
			_Name: "Server1",
			_TypeName: "t1.micro",
			_TypePPM: "1",
		})
	})
	.then(res => res.json())
	.then(data => result = data);

	return result;
}

function App() {
  const [data, setData] = React.useState(null);

//   React.useEffect(() => {
// 	fetch("/get")
// 	  .then((res) => res.json())
// 	  .then((data) => setData(data));
//   }, []);

  return (
	<div className="App">
	  <header className="App-header">
		<p>{!data ? "Loading..." : data}</p>
		<button onClick={() => setData(addServer())}>Add server</button>
	  </header>
	</div>
  );
}

export default App;
